import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';
import { MdOutlineLaptopChromebook } from "react-icons/md";
import './Services.css';

const Services = () => {
    return (
        <div className="py-5">
            <Container>
                <div className="text-center">
                    <h2 className="title">Services</h2>
                </div>
                <Row>
                    <Col md={4}>
                        <div className="card">
                            <div className="text-center">
                                <div className="card-icon-container mx-auto">
                                    <MdOutlineLaptopChromebook className="card-icon" />
                                </div>
                                <h5 className="card-title">USER INTERFACE</h5>
                                <p className="card-desc">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed eiusm.</p>
                            </div>
                        </div>
                    </Col>
                </Row>
            </Container>
        </div>
    );
};

export default Services;
